import React from 'react';

const cssstyle = {
  padding: '20px 20px',
  backgroundColor: '#ffe9c5',
  color: '#0000FF',
  borderRadius: '40px',
  textAlign:'right'
};
function App(){
  return(
    <>
    <div className="cards">
      <div className="card">
        <img src="https://picsum.photos/id/237/200/300" alt="cardImage" className="card-img"></img>
        <div>
          <span className="card-name" style= {cssstyle}>Dark</span>
        </div>
        <div>
        <span className="card-title">Original Netflix Series</span>
        </div>

      </div>
    </div>
    </>    
  )
};

export default App;
